import React from 'react';
import Logo from './Logo';

import {
	Row,
	Navbar,
	Nav,
	Col
} from 'react-bootstrap';

export default class Header extends React.Component {
	constructor(props) {
		super(props);
		this.state = {navLinks: this.props.nav};
	}
	
	render() {
		//let data = this.props.data;
		return (
			<header className="sticky-top">
				<Navbar  variant="dark" expand="sm">
					<Navbar.Brand href="/" >
						<Row>
							<Col xs={3} ><Logo className="" /></Col>
							<Col xs={9} >Daniel Ram√≠rez</Col>
						</Row>
					</Navbar.Brand>
					<Navbar.Toggle aria-controls="basic-navbar-nav" />
					<Navbar.Collapse className="justify-content-end">
						<Nav>

							<Nav.Link className="nav-link text-right" href="/">Home</Nav.Link>
							<Nav.Link className="nav-link text-right" href="#banners">Banners</Nav.Link>
							<Nav.Link className="nav-link text-right" href="#resume">Resume</Nav.Link>
						</Nav>
					</Navbar.Collapse>
				</Navbar>
			</header>
		)
	}
}
